import React, { useEffect, useState } from 'react';
import { connect } from 'react-redux';
import { Redirect } from 'react-router';

import Place from './Place';
import Places from './Placess';
import * as actions from '../../store/actions/index';
import * as api from '../../store/actions/api';
import socketIOClient from "socket.io-client";
import HomeIcon from '@material-ui/icons/Home';
import List from '@material-ui/core/List';
import { CircularProgress } from '@material-ui/core';
import { useStyles } from '../Styles/Styles';
import InfoPlace from './InfoPlace';

const PlacesPage = props => {

    var socket;
    if(socket == null) {
        socket = socketIOClient(api.URL_SOCKETIO, {
            withCredentials: true, transportOptions: {}
        });
    }

    const token = props.token
    socket.on("connect", () => {
        socket.emit("set-token", token)
        console.log("TOKEN: ")
        console.log(token)
    })

    return (
        <div>
            <Places socket={socket}></Places>
        </div>
    );
}

export default PlacesPage;
